import React from 'react';

function Authenticate() {
    const [registerUsername, setRegisterUsername] = useState()

    return (
        <div>
            <div>
                <h1>Register</h1>
                <input placeholder="username" />
                <input placeholder="password" />
                <button>Submit</button>
            </div>

            <div>
                <h1>Login</h1>
                <input placeholder="username" />
                <input placeholder="password" />
                <button>Submit</button>
            </div>



        </div>
    );
}


export default Authenticate;
